Description:
            Beautiful vintage painting of the Brooklyn Bridge. This piece has a niceworn and aged look to it. 
Condition // In good vintage condition. There is chipping to the paint in various areas and around the edges. This piece has beautiful muted pastel colors and a nice mid century feel. Signed Duchamp. No frame present. There is picture worse attached to the back to make hanging easy. 
Measurements // 16" long x 12" wide
